import React, {useState} from 'react'
import { Link } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Navbar() {
  function openMenu(e) {
    var menu = document.getElementById('menu');
    if (menu.style.display='none') {
      menu.style.display = 'block';
    }else if(e.target !== menu) {
      menu.style.display = 'none';
    }
  }
  return (
   <>
    <nav className="navbar">
        <div className="navbar-container">
           <li><a href='/'>Home</a></li>
           <li><a href='/#about-section'>About Us</a></li>
           <li><a href='/secrets-to-selling-your-storage-facility'>How We Help You</a></li>
           <li><a href='/team'>Our Team</a></li>
           <li><a href='/#contact'>Contact Us</a></li>
        </div>
    </nav>
    <div className='navbar-2' onClick={openMenu}>
      <FontAwesomeIcon icon="fa-solid fa-bars" />
    </div>
    <div className='menu' id='menu'>
      <li className='menu-item'><a href='' style={{color: 'black'}}>Home</a></li>
      <li className='menu-item'><a href='' style={{color: 'black'}}>About Us</a></li>
      <li className='menu-item'><a href='' style={{color: 'black'}}>How We Help You</a></li>
      <li className='menu-item'><a href='' style={{color: 'black'}}>Our Team</a></li>
      <li className='menu-item'><a href='' style={{color: 'black'}}>Contact Us</a></li>
    </div>
   </>
  )
}

export default Navbar
